	<script>
        const voivodeships = document.querySelectorAll('.voivodeship');
        const tooltip = document.getElementById('tooltip');

        // Aktualizacja pozycji tooltipa
        function updateTooltipPosition(e) {
            const offset = 15; // odstęp od kursora
            tooltip.style.left = (e.pageX + offset) + 'px';
            tooltip.style.top = (e.pageY + offset) + 'px';
        }

        // Dodawanie obsługi zdarzeń do każdego województwa
        voivodeships.forEach(voivodeship => {
            // Pokazywanie tooltipa
            voivodeship.addEventListener('mouseenter', (e) => {
                const name = e.target.getAttribute('data-name');
                tooltip.textContent = name;
                tooltip.style.display = 'block';
                updateTooltipPosition(e);
            });

            // Aktualizacja pozycji tooltipa podczas ruchu myszą
            voivodeship.addEventListener('mousemove', (e) => {
                updateTooltipPosition(e);
            });

            // Ukrywanie tooltipa
            voivodeship.addEventListener('mouseleave', () => {
                tooltip.style.display = 'none';
            });

            // Obsługa kliknięcia
            voivodeship.addEventListener('click', (e) => {
                const name = e.target.getAttribute('data-name');
                window.location.href = `quiz_wojew.php?wojewodztwo=${name}`;
            });
        });
    </script>
  </div>
